import React from 'react';
import './logIn.css';


export const LogIn = () => {

    const { register, handleSubmit, setError, formState: { errors, isValid } } = useForm({
        defaultValues: {
            email: '',
            password: '',
        },
        mode: 'onChange'
    })

    const onSubmit = async (value) => {
        const data = await dispatch(fetchAuth(value));

        if (!data.payload) {
            return alert('Unouthorized');
        }

        if ('token' in data.payload) {
            window.localStorage.setItem('token', data.payload.token);
        }
    }


    if (isAuth) {
        return <Navigate to="/" />
    }

    return (
        <div className="login-all">
            <div className="container">
                <div className="left-side"
                    style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/Logo_CSU_Suceava.png)` }} />
                <div className="right-side">
                    <Typography classes={{ root: styles.title }} variant="h5">
                        LogIn
                    </Typography>
                    <form onSubmit={handleSubmit(onSubmit)}>
                        <TextField
                            className={styles.field}
                            label="E-Mail"
                            error={Boolean(errors.email?.message)}
                            helperText={errors.email?.message}
                            type='email'
                            {...register('email', { required: " Insert E-mail" })}
                            fullWidth
                        />
                        <TextField
                            className={styles.field}
                            label="password"
                            error={Boolean(errors.password?.message)}
                            helperText={errors.password?.message}
                            {...register('password', { required: " Insert Password" })}
                            fullWidth />
                        <Button disabled={!isValid} type="submit" size="large" variant="contained" fullWidth>
                            LogIn
                        </Button>
                    </form>
                </div>
            </div >
        </div>
    );

}
